  false,\n\t\"url\": null,\n\t\"notes\": \"The Coral Reef Ecosystem Division of the
  Pacific Islands Fisheries Science Center, part of the National Marine Fisheries
  Service, National Oceanic and Atmospheric Administration (NOAA), conducted CTD profiling
  during 15 research cruises on the NOAA Ships Hi'ialakai, Townsend Cromwell, and
  Oscar Elton Sette in the years 1999 to 2012, totally 1,118 casts. Processed data
  include the profiles of temperature, salinity, oxygen, fluorescense, and other ancillary
  parameters. Most hydrocast stations are near atolls and islands. Casts in this NODC
  accession are referred to as deep profiles and mostly reach to 500 m. These casts
  are kept separate from casts of the same cruises that are designated as shallow.
  Shallow casts are stored in separate NODC accessions.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
